// Conteúdo de es2-ufpi/trackz/Trackz-dev/trackz-web/src/components/FormularioCadastro/FormularioCadastro.tsx

import React, { useState, ChangeEvent, FormEvent } from "react";
import styles from "./FormularioCadastro.module.css"; //
import Botao from "../Botao/botao"; //

// Definindo a interface para o estado do formulário
interface IFormularioCadastro {
  nome: string;
  email: string;
  usuario: string;
  senha: string;
  confirmarSenha: string;
}

// Definindo a interface para o estado de erros
interface IErros { // <--- VOCÊ TEM A INTERFACE DE ERROS AQUI!
  nome?: string;
  email?: string;
  usuario?: string;
  senha?: string;
  confirmarSenha?: string;
}

const FormularioCadastro: React.FC = () => {
  // Estado para os dados do formulário
  const [formulario, setFormulario] = useState<IFormularioCadastro>({ // <--- A VARIÁVEL DE ESTADO DO FORMULÁRIO CHAMA-SE 'formulario'
    nome: "",
    email: "",
    usuario: "",
    senha: "",
    confirmarSenha: "",
  });

  // Estado para as mensagens de erro
  const [erros, setErros] = useState<IErros>({}); // <--- VOCÊ USA A INTERFACE IErros AQUI

  // Função para lidar com mudanças nos inputs
  const handleChange = (e: ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormulario((prev) => ({
      ...prev,
      [name]: value,
    }));
    // Limpar erro do campo ao digitar
    if (erros[name as keyof IErros]) {
      setErros((prev) => ({
        ...prev,
        [name]: undefined,
      }));
    }
  };

  // Função para lidar com a submissão do formulário
  const handleSubmit = (e: FormEvent) => {
    e.preventDefault();
    // Validação (simples para exemplo, você deve ter uma mais robusta)
    let novosErros: IErros = {};
    if (!formulario.nome.trim()) novosErros.nome = "Nome completo é obrigatório.";
    if (!formulario.email.trim()) {
      novosErros.email = "Email é obrigatório.";
    } else if (!/\S+@\S+\.\S+/.test(formulario.email)) {
      novosErros.email = "Formato de email inválido.";
    }
    if (!formulario.usuario.trim()) novosErros.usuario = "Nome de usuário é obrigatório.";
    if (!formulario.senha) {
      novosErros.senha = "Senha é obrigatória.";
    } else if (formulario.senha.length < 6) {
        novosErros.senha = "A senha deve ter pelo menos 6 caracteres.";
    }
    if (formulario.senha !== formulario.confirmarSenha) {
      novosErros.confirmarSenha = "As senhas não coincidem.";
    }

    if (Object.keys(novosErros).length > 0) {
      setErros(novosErros);
      return;
    }

    // Lógica de submissão (ex: chamada de API)
    console.log("Dados do Formulário:", formulario); // Você usa 'formulario' aqui
    // Simulação de cadastro bem-sucedido
    alert("Usuário cadastrado com sucesso! (Simulação)");
    // Limpar formulário e erros após submissão (opcional)
    setFormulario({
      nome: "",
      email: "",
      usuario: "",
      senha: "",
      confirmarSenha: "",
    });
    setErros({});
  };

  return (
    <form className={styles.form} onSubmit={handleSubmit}>
      {/* Campo Nome Completo */}
      <label className={styles.label}> {/* Você usa styles.label aqui */}
        Nome Completo:
        <input
          type="text"
          name="nome" // 'name' corresponde à chave em IFormularioCadastro
          value={formulario.nome} // Usa formulario.nome
          onChange={handleChange}
          className={styles.input}
          required
          placeholder="Digite seu nome completo"
        />
        {erros.nome && <span className={styles.error}>{erros.nome}</span>} {/* Você usa styles.error aqui */}
      </label>

      {/* Campo Email */}
      <label className={styles.label}>
        Email:
        <input
          type="email" // Mudado para type="email"
          name="email"
          value={formulario.email} // Usa formulario.email
          onChange={handleChange}
          className={styles.input}
          required
          placeholder="Digite um email válido"
        />
        {erros.email && <span className={styles.error}>{erros.email}</span>}
      </label>

      {/* Campo Usuário */}
      <label className={styles.label}>
        Usuário:
        <input
          type="text"
          name="usuario"
          value={formulario.usuario} // Usa formulario.usuario
          onChange={handleChange}
          className={styles.input}
          required
          placeholder="Digite um nome de usuário"
        />
        {erros.usuario && <span className={styles.error}>{erros.usuario}</span>}
      </label>

      {/* Campo Senha */}
      <label className={styles.label}>
        Senha:
        <input
          type="password"
          name="senha"
          value={formulario.senha} // Usa formulario.senha
          onChange={handleChange}
          className={styles.input}
          required
          placeholder="Digite uma senha (mín. 6 caracteres)"
        />
        {erros.senha && <span className={styles.error}>{erros.senha}</span>}
      </label>

      {/* Campo Confirmar Senha */}
      <label className={styles.label}>
        Confirmar Senha:
        <input
          type="password"
          name="confirmarSenha"
          value={formulario.confirmarSenha} // Usa formulario.confirmarSenha
          onChange={handleChange}
          className={styles.input}
          required
          placeholder="Confirme a senha digitada"
        />
        {erros.confirmarSenha && <span className={styles.error}>{erros.confirmarSenha}</span>}
      </label>

      <Botao type="submit"> Cadastrar </Botao>
    </form>
  );
};

export default FormularioCadastro;
